              </Nav>

            {/* <Button variant='outline-light' onClick={()=>{
              Cookies.remove('login')
              navigate('/')
            }}>Log Out</Button> */}
          </Container>
        </Navbar>
        <SearchModal show={showSearch} onHide={setSearch}/>
    </>
  )
}
